    def get_response(self, data):
        initial_post = self.api_client.post(self.submit_url, format='json', data=data)
        postjsoncontent = json.loads(initial_post.content)
        uuid = json.loads(initial_post.content)['run_uuid']
        response = json.loads(self.api_client.get(self.results_url.replace('<run_uuid>', str(uuid))).content)
        return response

    def test_mira_loma(self):
        #test_post = os.path.join('reo', 'tests', 'posts', 'critical_load_bau_can_sustain_outage.json')
        #nested_data = json.load(open(test_post, 'rb'))
        response = self.get_response(data=self.post)
        messages = response['messages']
        tariff_out = response['outputs']['Scenario']['Site']['ElectricTariff']
        energy_purchased = np.array(tariff_out['year_one_to_battery_series_kw']) + np.array(tariff_out['year_one_to_load_series_kw'])
        tariff_in = response['inputs']['Scenario']['Site']['ElectricTariff']
        contract_quantities = np.array(tariff_in["contract_quantities_series_kwh"])
        contract_prices = np.array(tariff_in["contract_rates_series_us_dollars_per_kwh"])
        rtm_prices = np.array(tariff_in["real_time_market_rates_series_us_dollars_per_kwh"])
        fin_in = response['inputs']['Scenario']['Site']['Financial']

        contract_charge_expected_yr1 = np.sum(contract_quantities * contract_prices)
        excess_deficit_charge_expected_yr1 = np.sum((energy_purchased - contract_quantities) * rtm_prices)
        energy_charge_expected_yr1 = contract_charge_expected_yr1 + excess_deficit_charge_expected_yr1 + \
            tariff_in["blended_monthly_rates_us_dollars_per_kwh"][0] * np.sum(energy_purchased)
        pwf_e = annuity(fin_in['analysis_years'], fin_in['escalation_pct'], fin_in['offtaker_discount_pct'])
        contract_charge_expected_total = contract_charge_expected_yr1 * pwf_e * (1 - fin_in['offtaker_tax_pct'])
        excess_deficit_charge_expected_total = excess_deficit_charge_expected_yr1 * pwf_e * (1 - fin_in['offtaker_tax_pct'])
        energy_charge_expected_total = energy_charge_expected_yr1 * pwf_e * (1 - fin_in['offtaker_tax_pct'])

        try:
            self.assertEqual(round(tariff_out['total_contract_energy_cost_us_dollars']), round(contract_charge_expected_total),
                             "Total contract charges ({}) do not equal expected total contract charges ({})."
                             .format(tariff_out['total_contract_energy_cost_us_dollars'], contract_charge_expected_total))

        except Exception as e:
            error_msg = None
            if hasattr(messages, "error"):
                error_msg = messages.error
            print("test_lineage_mira_loma API error message: {}".format(error_msg))
            print("Run uuid: {}".format(response['outputs']['Scenario']['run_uuid']))
            raise e

        try:
            self.assertEqual(round(tariff_out['total_contract_excess_deficit_energy_cost_us_dollars']), round(excess_deficit_charge_expected_total),
                             "Total contract excess/deficit charges ({}) do not equal expected total contract excess/deficit charges ({})."
                             .format(tariff_out['total_contract_excess_deficit_energy_cost_us_dollars'], excess_deficit_charge_expected_total))

        except Exception as e:
            error_msg = None
            if hasattr(messages, "error"):
                error_msg = messages.error
            print("test_lineage_mira_loma API error message: {}".format(error_msg))
            print("Run uuid: {}".format(response['outputs']['Scenario']['run_uuid']))
            raise e

        try:
            self.assertEqual(round(tariff_out['total_energy_cost_us_dollars']), round(energy_charge_expected_total),
                             "Total energy charges ({}) do not equal expected total energy charges ({})."
                             .format(tariff_out['total_energy_cost_us_dollars'], energy_charge_expected_total))

        except Exception as e:
            error_msg = None
            if hasattr(messages, "error"):
                error_msg = messages.error
            print("test_lineage_mira_loma API error message: {}".format(error_msg))
            print("Run uuid: {}".format(response['outputs']['Scenario']['run_uuid']))
            raise e